import React, {Component} from 'react'
import Sidebar from './components/fixedComponents/sidebar';
import Header from './components/fixedComponents/header';
import HomeChart from './components/home/'

import api from '../../services/api'

class App extends Component {

  async componentDidMount() {
    const response = await api.get('/auth/user')
    console.log(response.data)
    if(response) {
        this.setState({
            users: response.data
        })
    }   
  }

  render() {
  return (
    <div>
      <Header />
      <Sidebar />
      <div className="home">
        Seja bem Vindo, selecione as opções do menu para continuar.
      </div>
      <div className="container">
        <div className="row">
          <div className="col s12">
            <div className="card-panel graficos">
              <p>Usuarios Novos.</p>
              <hr /><hr />
              <hr /><hr />
              <HomeChart />
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}}

export default App
